import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Home from "./Home/Home";
import Login from "./Login";
import Register from "./Register";
import EventForm from "./EventForm";
import About from "./About";
import Contact from "./Contact";
import NotFound from "./NotFound";
import Invitations from "./Invitations";
import Profile from "./Profile";
import Dashboard from "./dashboard";
import LoginDashboard from "./dashboard/login";
import Users from "./dashboard/users";
import AddUsers from "./dashboard/users/add";
import EventDetail from './EventDetils';



const events = [
  {
    id: 1,
    title: 'Event 1',
    description: 'Description for Event 1',
    address: '123 Main St',
    organizer: 'Organizer 1',
    attendees: 100,
    date: '2024-06-01',
    hour: '10:00 AM',
    photo: "./img/2.jpg", // Add the URL or path to the photo
  },
  {
    id: 2,
    title: 'Event 2',
    description: 'Description for Event 2',
    address: '456 Elm St',
    organizer: 'Organizer 2',
    attendees: 50,
    date: '2024-06-02',
    hour: '2:00 PM',
    photo: './img/3.jpg', // Add the URL or path to the photo
  },
  {
    id: 3,
    title: 'reem',
    description: 'Description for Event 1',
    address: '123 Main St',
    organizer: 'Organizer 1',
    attendees: 100,
    date: '2024-06-01',
    hour: '10:00 AM',
    photo: "./img/2.jpg", // Add the URL or path to the photo
  },
  {
    id: 4,
    title: 'fleb',
    description: 'Description for Event 1',
    address: '123 Main St',
    organizer: 'Organizer 1',
    attendees: 100,
    date: '2024-06-01',
    hour: '10:00 AM',
    photo: "./img/2.jpg", // Add the URL or path to the photo
  },
  {
    id: 5,
    title: 'jo',
    description: 'Description for Event 1',
    address: '123 Main St',
    organizer: 'Organizer 1',
    attendees: 100,
    date: '2024-06-01',
    hour: '10:00 AM',
    photo: "./img/2.jpg", // Add the URL or path to the photo
  },
  {
    id: 6,
    title: 'mena',
    description: 'Description for Event 1',
    address: '123 Main St',
    organizer: 'Organizer 1',
    attendees: 100,
    date: '2024-06-01',
    hour: '10:00 AM',
    photo: "./img/2.jpg", // Add the URL or path to the photo
  },
  {
    id: 7,
    title: 'aya',
    description: 'Description for Event 1',
    address: '123 Main St',
    organizer: 'Organizer 1',
    attendees: 100,
    date: '2024-06-01',
    hour: '10:00 AM',
    photo: "./img/2.jpg", // Add the URL or path to the photo
  },
  {
    id: 8,
    title: 'hassan',
    description: 'Description for Event 1',
    address: '123 Main St',
    organizer: 'Organizer 1',
    attendees: 100,
    date: '2024-06-01',
    hour: '10:00 AM',
    photo: "./img/2.jpg", // Add the URL or path to the photo
  },
  // Add more events as needed
];


const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route exact path="/home" element={<Home events={events} />} />
        <Route path="/events/:id" element={<EventDetail events={events} />} />
        <Route path="/event" element={<EventForm />} />
        <Route path="/invit" element={<Invitations />} />
        <Route path="/profile" element={<Profile />} />
        <Route path="/about" element={<About />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="*" element={<Home />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/dashboard/login" element={<LoginDashboard />} />
        <Route path="/dashboard/users" element={<Users />} />
        <Route path="/dashboard/users/add" element={<AddUsers />} />
      </Routes>
    </BrowserRouter>
  </React.StrictMode>
);
